<html><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8"><style>
.map_main_panel {
	height:100%;
}

/* nodes */

text {
    font-weight: 300;
    font-family:"Helvetica Neue", Helvetica, Arial, sans-serf;
    font-size: 12px;
}
.node rect,
.node circle {
    stroke: #999;
    fill: #fff;
    stroke-width: 1.5px;
}

.shape_participant circle{
    stroke: #999;
    fill: #ddf;
    stroke-width: 1.5px;
}

.node {
    cursor: pointer;
}

/* individual */


.shape_unknown rect {
	fill:#8df;
}
.shape_undefined rect {
	fill:#8df;
}


.shape_root rect,
.shape_root circle
 {
    stroke: #999;
	fill:#f44;
    stroke-width: 1.5px;
}
.shape_result rect,
.shape_result circle
 {
	fill:#99f;
}
.shape_cause rect,
.shape_cause circle {
	fill:#3f3;
}

.shape_mouse rect,
.shape_mouse circle {
	fill:#FD0;
}

.shape_rat rect,
.shape_rat circle {
	fill:#FD0;
}

.shape_mouse.shape_vitro rect,
.shape_mouse.shape_vitro circle {
	fill:#f94;
}

.shape_rat.shape_vitro rect,
.shape_rat.shape_vitro circle {
	fill:#f94;
}


.shape_vivo rect,
.shape_vivo circle {
	fill:#FD0;
}

.shape_vitro rect,
.shape_vitro circle {
	fill:#F00;
}
.shape_canonical rect,
.shape_vitro_invalid circle,
.shape_vivo_invalid circle,
.shape_canonical circle {
	fill:#fcc;
}



.shape_node rect {
	fill:#8df;
}

.shape_part_process rect {
	fill:#8df;
}
/*
.shape_participant rect,
.shape_participant circle
 {
	fill:#ff7;
}*/

.shape_combine rect,
.shape_combine circle {
    stroke: #999;
    stroke-width: 3.0px;
/*    stroke-dasharray: 5,5;*/
	fill:#00f;
}

.shape_notice rect,
.shape_notice circle {
	stroke:#f00;
	stroke-width:5px;
}

.highlighted g.label {
	background-image: url(../../img/bg-red.png);
	fill:#ff0000;
}



/* edges */

.edgePath path {
	fill:none;
    stroke: #333;
    stroke-width: 3px;
	stroke-opacity:1.0;
    cursor: pointer;
}
path.arrowhead{
    fill: #333;
	fill-opacity:0.9;
 }


/* selected path */
.edgePath path.path_selected {
    stroke-width: 10px;
    stroke: #FF0000;
	stroke-opacity:1;
}



/* part */
.edge_has_part path,
.edge_partOf path
 {
	stroke: #00f;
	stroke-dasharray: 3,3,15,3;
}
.edge_has_part path.arrowhead,
.edge_partOf path.arrowhead
{
	fill: #00f;
}

/* result */
.edge_hasResult path {
	stroke: #000;
}
.edge_hasResult path.arrowhead
{
	fill: #000;
}

/* pathway */
.edge_has_Pathway path,
.edge_PathwayOf path
 {
	stroke: #0ff;
	stroke-dasharray: 3,3,15,3;
}
.edge_has_Pathway path.arrowhead,
.edge_PathwayOf path.arrowhead
{
	fill: #0ff;
}

/* Molecular_reaction */
.edge_has_Molecular_reaction path,
.edge_Molecular_reactionwayOf path
 {
	stroke: #f0f;
	stroke-dasharray: 3,3,15,3;
}
.edge_has_Molecular_reaction path.arrowhead,
.edge_Molecular_reactionOf path.arrowhead
{
	fill: #f0f;
}

/* hasParticipant */
.edge_hasParticipant path
 {
	stroke: #0f0;
	stroke-linecap:round;
	stroke-dasharray: 1,8;
}
.edge_hasParticipant path.arrowhead
{
	fill: #0f0;
}

/* hasAgent */
.edge_hasAgent path
 {
	stroke: #fd0;
	stroke-linecap:round;
	stroke-dasharray: 1,8;
}
.edge_hasAgent path.arrowhead
{
	fill: #fd0;
}

/* hasInput */
.edge_hasInput path
 {
	stroke: #00f;
	stroke-linecap:round;
	stroke-dasharray: 1,8;
}
.edge_hasInput path.arrowhead
{
	fill: #00f;
}

/* hasOutput */
.edge_hasOutput path
 {
	stroke: #f00;
	stroke-linecap:round;
	stroke-dasharray: 1,8;
}
.edge_hasOutput path.arrowhead
{
	fill: #f00;
}

path.arrowhead_none {
	stroke:rgba(1,1,1,0) !important;
	stroke-width:1 !important;
}

.edgePath path.dp_path   {
/*	stroke-linecap: round;*/
	stroke-linecap: unset;
}

.edgePath.edge_depth_0 path.dp_path   {

}

.edgePath.edge_depth_5 path.arrowhead_none   {

}


.edgePath.edge_width_0 path.dp_path   {
	stroke:rgba(1,1,1,0);

	}

.edgePath.edge_width_1 path.dp_path   {
